import React from 'react'
import styled from 'styled-components'

const HeroStyled = styled.section`
    background-color: pink;
    border-radius: 20px;
    display: flex;
    margin: 0 auto;
    width: 100%;
    height: 80vh;
    max-width: 1360px;

`;

const Hero = () => {
    return (
        <HeroStyled>
            <h1>I'm a hero</h1>
        </HeroStyled>
    )
}

export default Hero
